import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import ListGroup from 'react-bootstrap/ListGroup';

export default function AppFooter() {
    return(
        <section className='footer'>
        <Container>
      <Row>
        <Col>1 of 1</Col>

        <Col>

            <ul>
                <li><b>Home</b></li>
                <li>Services</li>
                <li>Blog</li>
                <li>Careers</li>
                <li>Contact us</li>
            </ul>


        </Col>

        <Col>1 of 1</Col>
        <Col>1 of 1</Col>
      </Row>
    </Container>
    </section>
    )
}
